import React from 'react';
import '../../App.css';
import {Nav,
    NavLink, 
    Bars,
    NavMenu,DropDownContainer,DropDownHeader,DropDownListContainer} from  './NavBarElements';
import { TiMessages } from "react-icons/ti";

import { AiOutlineBell } from "react-icons/ai";



const TopBar =() => {
  return (
    <Nav className="Nav">
         <NavLink to="/">
                <h1>Logo</h1>
         </NavLink>
        <Bars />

    <NavMenu>
        <NavLink to="/about"  activeSytle>
        <TiMessages/>
         </NavLink>
         <NavLink to="/services" activeSytle>
            <AiOutlineBell/>
         </NavLink>
         <NavLink to="/about" activeSytle>
            Contact us
         </NavLink>

         <DropDownContainer>
        <DropDownHeader>Mangoes</DropDownHeader>
        <DropDownListContainer>
          <DropDownList>
            <ListItem>Mangoes</ListItem>
            <ListItem>Apples</ListItem>
            <ListItem>Oranges</ListItem>
          </DropDownList>
        </DropDownListContainer>
      </DropDownContainer>
    </NavMenu>
        
    </Nav>
  );
}

export default TopBar ;
